/**
 * @param {number[]} A
 * @return {number}
 */
var maxRotateFunction = function(A) {
    if (A === null || A === undefined || A.length === 0) {
        return 0;
    }
    
    let max = 0;
    
    for (let i = 0; i <A.length; i++) {
        max += i * A[i];
    }
    
    for (let i = 1; i < A.length; i++) {
        let tmpSum = 0;
        for (let j = 0; j < A.length; j++) {
            let index = j
            if (index + i > A.length-1 ) {
                index = index + i - A.length;
            } else {
                index = index + i;
            }
            tmpSum += j * A[index];
        }
        if (tmpSum > max) {
            max =tmpSum;
        }
    }
    
    return max;   
};

